import React from "react";
import { NavLink } from "react-router-dom";

const Home = () => {

    return(
        <div>
            <NavLink to="./Patient">Patient</NavLink>
            <br />
            <NavLink to="./Home">Home</NavLink>
            <br />
            <NavLink to="./Clinician">Clinician</NavLink>
        </div>
    );

};

export default Home;
